import React from "react";

const Message = ({ message }) => {
  return (
    <div className={`message ${message.sender === "You" ? "self" : ""}`}>
      <strong>{message.sender}: </strong>
      <span>{message.text}</span>
    </div>
  );
};

export default Message;
